    private void btnRegisterPatientActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_btnRegisterPatientActionPerformed

        // TODO add your handling code here:
        String nameOfPatient=txtPatientName.getText();
        String dobDay=comboYearRec.getSelectedItem().toString();
        String dobMonth=comboMonthRec.getSelectedItem().toString();
        String dobYear=comboDayRec.getSelectedItem().toString();
        String age=dobDay+"-"+dobMonth+"-"+dobYear;
        String genderOfPatient=comboGender.getSelectedItem().toString();
        String locationOfPatient=txtLocation.getText();
        String IdOfpatient=txtIdNo.getText();
        String phoneOfPatient=txtPhone.getText();
        String addressOfPatient=txtAddress.getText();
        String patientCardNo=txtCardNo.getText();
        String patientType = comboPatientType.getSelectedItem().toString();
        
        String IDNO = comboIdNo.getSelectedItem().toString();
        String address=comboAddress.getSelectedItem().toString();
        String cardNo=comboCardNo.getSelectedItem().toString();
        String uniqid =kMethods.gen();
        
        //JOptionPane.showMessageDialog(null, uniqid);
        
        if(nameOfPatient.length()==0 || locationOfPatient.length()==0){
            JOptionPane.showMessageDialog(null, "The name and location of the patient should be filled.");
        }else if(phoneOfPatient.length()!=10){
            JOptionPane.showMessageDialog(null, "Phone number is incorrect. It should be 10 digits.");
        }else if(dobDay.equalsIgnoreCase("day") || dobMonth.equalsIgnoreCase("month") || dobYear.equalsIgnoreCase("year")){
            JOptionPane.showMessageDialog(null, "Select correct date format.");
        }else if(patientType.equalsIgnoreCase("select...")){
           JOptionPane.showMessageDialog(null, "Select correct patient type."); 
        }else if(patientType.equalsIgnoreCase("corporate") && patientCardNo.length()==0){
           JOptionPane.showMessageDialog(null, "Enter corporate's patient card number."); 
        }else if(genderOfPatient.equalsIgnoreCase("select...")){
            JOptionPane.showMessageDialog(null, "Select patient gender");
        }else if(IDNO.equalsIgnoreCase("select...")){
            JOptionPane.showMessageDialog(null, "Select correct patient ID option.");
        }else if(IDNO.equalsIgnoreCase("n/a")){
            IdOfpatient="N/A";
        }else if(IDNO.equalsIgnoreCase("no:") && IdOfpatient.length()==0){
            JOptionPane.showMessageDialog(null, "please fill the patient ID Number");
        }else if(address.equalsIgnoreCase("SELECT...")){
            JOptionPane.showMessageDialog(null, "Select correct address option.");
        }else if(address.equalsIgnoreCase("n/a")){
            addressOfPatient="N/A";
        }else if(address.equalsIgnoreCase("no:") && addressOfPatient.length()==0){
            JOptionPane.showMessageDialog(null, "please fill the patient address");
        }else if(cardNo.equalsIgnoreCase("select...")){
            JOptionPane.showMessageDialog(null, "Select correct patient card number option.");
        }else if(cardNo.equalsIgnoreCase("n/a")){
            patientCardNo="N/A";
        }else if(cardNo.equalsIgnoreCase("no:") && patientCardNo.length()==0){
            JOptionPane.showMessageDialog(null, "please fill the patient card number");
        }   
        else{
            String insertPatient="INSERT INTO patient (uniqid,name,dob,gender,location,idno,phone,address,cardno,patienttype) VALUES ('"+uniqid+"','"+nameOfPatient+"','"+age+"','"+addressOfPatient+"','"+locationOfPatient+"','"+IdOfpatient+"','"+phoneOfPatient+"','"+addressOfPatient+"','"+patientCardNo+"','"+patientType+"')";
            if (new connection().Insert(insertPatient)==true){
               JOptionPane.showMessageDialog(null, "patient registered successfully"); 
            }else{
               JOptionPane.showMessageDialog(null, "patient registration failed."); 
            }
        }
    }//GEN-LAST:event_btnRegisterPatientActionPerformed

