    private void txtPatientRecFilterKeyReleased(java.awt.event.KeyEvent evt) {//GEN-FIRST:event_txtPatientRecFilterKeyReleased
        String patientRecFilter = comboPatientRecFilter.getSelectedItem().toString();
        String patientSearch = txtPatientRecFilter.getText();
        if(patientRecFilter.equalsIgnoreCase("name")){
            tablePatientReception.setModel(new connection().PopulateTable("SELECT * FROM patient WHERE name LIKE '%"+patientSearch+"%'"));
        }else if(patientRecFilter.equalsIgnoreCase("card no")){
            tablePatientReception.setModel(new connection().PopulateTable("SELECT * FROM patient WHERE patientno LIKE '%"+patientSearch+"%'"));
        }else if(patientRecFilter.equalsIgnoreCase("ID NO")){
            tablePatientReception.setModel(new connection().PopulateTable("SELECT * FROM patient WHERE idno LIKE '%"+patientSearch+"%'"));
        }else if(patientRecFilter.equalsIgnoreCase("phone")){
            tablePatientReception.setModel(new connection().PopulateTable("SELECT * FROM patient WHERE phone LIKE '%"+patientSearch+"%'"));
        }else if(patientRecFilter.equalsIgnoreCase("location")){
            tablePatientReception.setModel(new connection().PopulateTable("SELECT * FROM patient WHERE location LIKE '%"+patientSearch+"%'"));
        }
    }//GEN-LAST:event_txtPatientRecFilterKeyReleased

