    private void tablePatientReceptionMouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_tablePatientReceptionMouseClicked
        int row = tablePatientReception.getSelectedRow();
        labelNumPatientDetails.setText(tablePatientReception.getValueAt(row, 0).toString());
        labelNamePatientDetails.setText(tablePatientReception.getValueAt(row, 2).toString());
        labelPhonePatientDetails.setText(tablePatientReception.getValueAt(row, 7).toString());
        labelLocPatientDetails.setText(tablePatientReception.getValueAt(row, 5).toString());
    }//GEN-LAST:event_tablePatientReceptionMouseClicked

